      <Navigation />
      <div className='NewPassComp'>
        <div>
          <input type='text' name='' id='' />
          <input type='password' name='' id='' />
        </div>
        <div>
          <input type='search' name='' id='' />
          <div placeholder='users to add'>User X</div>
        </div>
      </div>
    </div>
  );
};

export default NewPassComp;
